fld.exp:
(
' AUTOEXTEND ' + 
  (SWITCH (autoextend) :
    ( CASE ( = 'ON') 
      RETURN (' ON NEXT ' + autoExtNextSize+autoExtUnit+ 
              ' MAXSIZE ' +
              (SWITCH (autoExtMaxSize) :
                ( CASE ( = 'UNLIMITED') RETURN (' UNLIMITED ' ) ,  
                  CASE (DEFAULT) RETURN  (autoExtMaxSize+autoExtUnit))
               )
             ),
      CASE ( = 'OFF') RETURN(' OFF '),
      CASE (DEFAULT) RETURN(' ERROR ' + autoextend)
    )
  )
)

(
SWITCH (UPPER(reuse)) :
  ( CASE ( = 'TRUE') RETURN (' REUSE ' ) , 
    CASE (DEFAULT) RETURN  ('')
  )
)

